import React from "react";
import { Container } from "react-bootstrap";

let movieList = () => {
    return (
            <Container>
                <div className="wrapper">
                    <div className="cart">
                        <div className="img">
                            <img src="../images/moviesImg.jpg"/>
                        </div>
                    </div>
                </div>
            </Container>
    )
}

export default movieList
